subroutine nml_reader ( parameters, dir_working )

  use input_parameters
  use constants_and_parameters
  implicit NONE

  ! subroutine arguments
  type ( input_deck ),    intent ( out ) :: parameters
  character ( len = 64 ), intent ( out ) :: dir_working

  integer   ( lint )                     :: num_intervals
  integer   ( lint )                     :: io_status

  real      ( dp )                       :: domain_a, domain_b        ! x \in [ a, b ]
  real      ( dp )                       :: xi_pressure,  xi_density  ! wall thickness
  real      ( dp )                       :: eta_pressure, eta_density ! depth ( quadratic )

  character ( len = 64 )                 :: file_name_locator
  character ( len = 64 )                 :: file_name_domain, file_name_toy_pressure, file_name_toy_density
  character ( len = 99 )                 :: dir_nml, file_name, io_msg

! +++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++          NAMELISTS

  namelist / locator /             file_name_domain, file_name_toy_pressure, file_name_toy_density
  namelist / domain /              num_intervals, domain_a, domain_b
  namelist / toy_pressure /        xi_pressure,  eta_pressure
  namelist / toy_density /         xi_density, eta_density

  call getcwd ( dir_working )
  print *, 'working directory = ', dir_working

! locator  ----------------------------------------------------------

  ! read command file
  dir_nml           = trim ( dir_working ) // '/data/'
  file_name_locator = 'namelist locator.nml'
  file_name         = trim ( dir_nml ) // file_name_locator
  write ( *, * ) 'reading namelist locator ', file_name

  ! open namelist
  open ( unit = io_unit_nml, file = file_name, delim = 'apostrophe', iostat = io_status, iomsg = io_msg )
  if ( io_status /= 0 ) then                               ! can't open file
    write ( *,  * )
    write ( *,  * ) 'unable to open file ', file_name
    write ( *,  * ) 'trying to read namelist locator'
    write ( *,  * ) 'io unit = ', io_unit_nml
    write ( *,  * ) 'iostat  = ', io_status
    write ( *,  * ) 'iomsg   = ', io_msg
    stop  'error during file open'
  end if

  ! read namelist
  read ( unit = io_unit_nml, nml = locator, iostat = io_status, iomsg = io_msg )
  if ( io_status /= 0 ) then                               ! can't read file
    write ( *,  * )
    write ( *,  * ) 'unable to read file ', file_name
    write ( *,  * ) 'trying to read namelist locator'
    write ( *,  * ) 'io unit = ', io_unit_nml
    write ( *,  * ) 'iostat  = ', io_status
    write ( *,  * ) 'iomsg   = ', io_msg
    stop  'error during file read'
  end if

  ! close file
  close ( unit = io_unit_nml, iostat = io_status, iomsg = io_msg )
  if ( io_status /= 0 ) then                              ! can't close file
    write ( *,  * )
    write ( *,  * ) 'unable to close file ', file_name
    write ( *,  * ) 'trying to read namelist locator'
    write ( *,  * ) 'io unit = ', io_unit_nml
