  end if

  ! close file
  close ( unit = io_unit_nml, iostat = io_status, iomsg = io_msg )
  if ( io_status /= 0 ) then                              ! can't close file
    write ( *,  * )
    write ( *,  * ) 'unable to close file ', file_name
